import React, { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { toast } from "react-toastify";
import { createUrl, log } from "../../utils/utils";
import { getDoctorById } from "../../services/user";
import { Link } from "react-router-dom";
import { useEffect } from "react";

const ServiceBook1 = () => {
  const { id, name } = useParams();
  // const [description, setDescription] = useState("");
  // const [carId, setCarId] = useState("");
  const [doctor, setDoctor] = useState([]);
  const navigate = useNavigate();

  const services = [{ id: 1, option: "Edit Profile" }];

  useEffect(() => {
    getDoctor();
  }, []);
  const getDoctor = async () => {
    try {
      const doctorId = sessionStorage.getItem("userId");
      console.log(doctorId);
      const response = await getDoctorById(doctorId);
      console.log(response);
      setDoctor(response);
    } catch (error) {
      console.error(error);
      toast.error("An error occurred during getching doctor");
    }
  };

  const Back = () => {
    navigate("/DoctorServices");
  };

  return (
    <div class="container">
      <div class="row">
        <div class="col"></div>
        <div class="col">
          <div class="form">
            <h1>Your Profile</h1>
            <div class="mb-3">
              <div class="table-responsive">
                <table class="table">
                  <tbody>
                    <tr>
                      <td colSpan="1"> Name:</td>
                      <td>{doctor.dname} </td>
                    </tr>
                    <tr>
                      <td>Email: </td>
                      <td>{doctor.email}</td>
                    </tr>
                    <tr>
                      <td>Password:</td>
                      <td>{doctor.password} </td>
                    </tr>
                    <tr>
                      <td>Contact No: </td>
                      <td>{doctor.dcontactNo}</td>
                    </tr>
                    <tr>
                      <td>Specialisation: </td>
                      <td>{doctor.dspecialisation}</td>
                    </tr>
                    {/* <tr>
                  
                      <td>
                        
                      <td>Schedule Day: </td>
                        <ul>
                          {doctor.dschedule.map((schedule, index) => (
                            <li key={index}>{schedule.day}</li>
                          ))}
                        </ul>
                      </td>
                    </tr> */}
                    {/* <tr>
                      <td>Schedule: </td>
                      <td>{doctor.dschedule}</td>
                    </tr> */}
                    {/* <tr>
                      <td>BloodGroup: </td>
                      <td>{patient.pbloodGroup}</td>
                    </tr> */}

                    <tr></tr>
                  </tbody>
                </table>
              </div>
            </div>

            {/* <button type="submit" class="btn btn-success" onClick={getPatient}>
              Submit
            </button> */}
          </div>
          <ul className="services-list">
            {services.map((service) => (
              <li key={service.id} className="service-box">
                <div className="service-content"></div>
                <Link
                  to={{
                    pathname: `/doctorEdit/${sessionStorage.getItem("userId")}`,
                    state: { serviceData: service },
                  }}
                  className="btn btn-primary"
                >
                  {service.option}
                </Link>
              </li>
            ))}
          </ul>
        </div>
        <div class="col"></div>
        <div>
          <button className="btn btn-primary" onClick={Back}>
            Back
          </button>
        </div>
      </div>
    </div>
  );
};

export default ServiceBook1;

